import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import data from './urun.json';
import Produkts from "./components/produkts"
import Headear from './components/header';

const kategoriResimleri = {
  Kahvalti: "data:image/jpeg;base64,",
  icecek: "data:image/jpeg;base64,",
  yemek : "data:image/jpeg;base64,",
  tatli : "data:image/jpeg;base64,"
  // Diğer kategoriler ve resimleri...
};

const App = () => {
  const [showCategories, setShowCategories] = useState(true);
  const kategoriler = [...new Set(data.map(item => item.kategori))];

  const handleCategoryClick = () => {
    setShowCategories(false);
  };

  return (
    <Router>
      <Headear/>
      <div style={{display: "flex", flexDirection: "column", alignItems: "center", background :"#FFF1DB", height:"100vh" }}>
        {showCategories && (
          <div style={{marginTop : "50px",width:"100%"}}>
            <h1 style={{marginLeft : "30px"}}>Kategoriler</h1>
            <div style={{display: "flex", flexDirection: "row", alignItems: "center", width:"100%", justifyContent:"space-around" }}>
              {kategoriler.map((kategori, index) => (
                <Link key={index} to={`/kategori/${kategori}`} onClick={handleCategoryClick}>
                  {/* <img src={kategoriResimleri[kategori]} alt={kategori} style={{width: "100px", height: "100px", marginBottom: "10px"}} /> */}
                  <button style={{margin: "10px", padding: "10px", width : "100%"}}> <img src={kategoriResimleri[kategori]} alt={kategori} style={{width: "50%", height: "100%", marginBottom: "10px"}} /> <br/> {kategori} </button>
                </Link>
              ))}
            </div>
          </div>
        )}
        <Routes>
          <Route path="/kategori/:kategoriAdi" element={<Produkts setShowCategories={setShowCategories} />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
